// Coloque aqui suas actions
export const USER = 'USER';
export const WALLET = 'WALLET';

export const actionUser = (payload) => ({
  type: USER,
  payload,
});

export const actionWallet = (wallet) => ({
  type: WALLET,
  wallet,
});
